(397, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:70:\"Elementor Pro 3.5: Create Fully Unique, Holistic Ecommerce Experiences\";s:7:\"excerpt\";s:243:\"Meet Elementors new Pro WooCommerce widgets! A set of tools that will provide you with more flexibility to design and customize your online stores: Cart, Checkout, and My Account, along with the new, faster way to configure your shop pages.\";s:7:\"created\";i:1637063184;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:132:\"https://elementor.com/blog/new-woocommerce-builder-features/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:33:\"Elementor Website of October 2021\";s:7:\"excerpt\";s:241:\"There are more than tricks and treats to learn from Octobers terrific showcase. Covering all bases, several places, and even some faces, our latest collection takes you from the Mesozoic to the modern, one pixel-perfect website at a time.\";s:7:\"created\";i:1636648561;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/showcase-october-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:65:\"Improving Your Landing Page Conversion Rate: A Step-by-Step Guide\";s:7:\"excerpt\";s:124:\"Learn how to work design and copy to boost your landing pages conversion rate, and see real Elementor examples in action.\";s:7:\"created\";i:1636574084;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:148:\"https://elementor.com/blog/how-to-improve-your-landing-page-conversion-rate/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:50:\"8 Black Friday Marketing Strategies & Ideas (2021)\";s:7:\"excerpt\";s:138:\"Increase profits from upcoming seasonal sales with these 8 Black Friday marketing tips. Make sure your WordPress website comes out on top!\";s:7:\"created\";i:1634704980;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/black-friday-marketing/?utm_so