(355, 92, '_elementor_data', '[{\"id\":\"2bd10ef8\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"41dc9d8\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"1279b846\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<!-- wp:separator {\\\"className\\\":\\\"is-style-wide\\\"} -->\\n<hr class=\\\"wp-block-separator is-style-wide\\\"\\/>\\n<!-- \\/wp:separator -->\\n\\n<!-- wp:separator {\\\"className\\\":\\\"is-style-wide\\\"} -->\\n<hr class=\\\"wp-block-separator is-style-wide\\\"\\/>\\n<!-- \\/wp:separator -->\\n\\n<!-- wp:group -->\\n<div class=\\\"wp-block-group\\\"><!-- wp:paragraph {\\\"align\\\":\\\"left\\\"} -->\\n<p class=\\\"has-text-align-left\\\">A&nbsp;<strong>flower<\\/strong>, sometimes known as a&nbsp;<strong>bloom<\\/strong>&nbsp;or&nbsp;<strong><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Blossom\\\">blossom<\\/a><\\/strong>, is the&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Reproduction\\\">reproductive<\\/a>&nbsp;structure found in&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Flowering_plant\\\">flowering plants<\\/a>&nbsp;(plants of the division&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Magnoliophyta\\\">Magnoliophyta<\\/a>, also called&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Angiosperms\\\">angiosperms<\\/a>). The biological function of a flower is to facilitate reproduction, usually by providing a mechanism for the union of&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Sperm\\\">sperm<\\/a>&nbsp;with eggs. Flowers may facilitate outcrossing (fusion of sperm and eggs from different individuals in a population) resulting from cross-pollination or allow selfing (fusion of sperm and egg from the same flower) when self-pollination occurs.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:paragraph {\\\"align\\\":\\\"left\\\"} -->\\n<p class=\\\"has-text-align-left\\\">The two types of pollination are: self-pollination and cross-pollination.&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Self-pollination\\\">Self-pollination<\\/a>&nbsp;happens when the pollen from the anther is deposited on the stigma of the same flower, or another flower on the same plant.&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Cross-pollination\\\">Cross-pollination<\\/a>&nbsp;is the transfer of pollen from the anther of one flower to the stigma of another flower on a different individual of the same species. Self-pollination happens in flowers where the stamen and carpel mature at the same time, and are positioned so that the pollen can land on the flower\'s stigma. This pollination does not require an investment from the plant to provide nectar and pollen as food for pollinators.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<!-- \\/wp:group -->\\n\\n<!-- wp:post-content \\/-->\\n\\n<!-- wp:post-terms {\\\"term\\\":\\\"category\\\"} \\/-->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a2fb9f4\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"19d5d09\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"c5d938f\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"062dfd9\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"30db905\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"63ad04a\",\"elType\":\"widget\",\"settings\":{\"title\":\"Our Location\",\"title_color\":\"#127199\",\"typography_typography\":\"custom\",\"typography_font_family\":\"RocknRoll One\",\"typography_font_size\":{\"unit\":\"px\",\"size\":38,\"sizes\":[]},\"typography_font_weight\":\"600\",\"typography_line_height\":{\"unit\":\"px\",\"size\":53,\"sizes\":[]},\"typography_letter_spacing\":{\"unit\":\"px\",\"size\":1.6,\"sizes\":[]}},\"elements\":[],\"widget