.&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Self-pollination\\\">Self-pollination<\\/a>&nbsp;happens when the pollen from the anther is deposited on the stigma of the same flower, or another flower on the same plant.&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Cross-pollination\\\">Cross-pollination<\\/a>&nbsp;is the transfer of pollen from the anther of one flower to the stigma of another flower on a different individual of the same species. Self-pollination happens in flowers where the stamen and carpel mature at the same time, and are positioned so that the pollen can land on the flower\'s stigma. This pollination does not require an investment from the plant to provide nectar and pollen as food for pollinators.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<!-- \\/wp:group -->\\n\\n<!-- wp:post-content \\/-->\\n\\n<!-- wp:post-terms {\\\"term\\\":\\\"category\\\"} \\/-->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a2fb9f4\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"19d5d09\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"c5d938f\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"062dfd9\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"30db905\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"63ad04a\",\"elType\":\"widget\",\"settings\":{\"title\":\"Our Location\",\"title_color\":\"#127199\",\"typography_typography\":\"custom\",\"typography_font_family\":\"RocknRoll One\",\"typography_font_size\":{\"unit\":\"px\",\"size\":38,\"sizes\":[]},\"typography_font_weight\":\"600\",\"typography_line_height\":{\"unit\":\"px\",\"size\":53,\"sizes\":[]},\"typography_letter_spacing\":{\"unit\":\"px\",\"size\":1.6,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"16ba445\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"d56bd6f\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"1e4f27b\",\"elType\":\"widget\",\"settings\":{\"address\":\"kalamati,kathmandu\",\"zoom\":{\"unit\":\"px\",\"size\":15,\"sizes\":[]},\"height\":{\"unit\":\"px\",\"size\":426,\"sizes\":[]},\"css_filters_hover_css_filter\":\"custom\",\"css_filters_hover_brightness\":{\"unit\":\"px\",\"size\":93,\"sizes\":[]},\"css_filters_hover_contrast\":{\"unit\":\"px\",\"size\":92,\"sizes\":[]},\"hover_transition\":{\"unit\":\"px\",\"size\":0.3,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"google_maps\"}],\"isInner\":false}],\"isInner\":false}]'),
