ss=\"wp-image-28\" width=\"215\" height=\"142\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:verse -->\n<pre class=\"wp-block-verse\">NAME : Sample   price : 120</pre>\n<!-- /wp:verse --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"25%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:25%\"><!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:image {\"id\":23,\"width\":249,\"height\":140,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3-1024x576.jpg\" alt=\"\" class=\"wp-image-23\" width=\"249\" height=\"140\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:verse -->\n<pre class=\"wp-block-verse\">NAME : Sample  price : 120</pre>\n<!-- /wp:verse --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Flower', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2021-10-22 02:45:59', '2021-10-22 02:45:59', '', 7, 'http://localhost/wordpress/?p=36', 0, 'revision', '', 0),
(41, 1, '2021-10-23 09:23:29', '2021-10-23 09:23:29', '<!-- wp:separator -->\n<hr/>\n<!-- /wp:separator -->\n\n<!-- wp:separator -->\n<hr/>\n<!-- /wp:separator -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\"><p>A&nbsp;<strong>flower</strong>, sometimes known as a&nbsp;<strong>bloom</strong>&nbsp;or&nbsp;<strong><a href=\"https://en.wikipedia.org/wiki/Blossom\">blossom</a></strong>, is the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reproduction\">reproductive</a>&nbsp;structure found in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Flowering_plant\">flowering plants</a>&nbsp;(plants of the division&nbsp;<a href=\"https://en.wikipedia.org/wiki/Magnoliophyta\">Magnoliophyta</a>, also called&nbsp;<a href=\"https://en.wikipedia.org/wiki/Angiosperms\">angiosperms</a>). The biological function of a flower is to facilitate reproduction, usually by providing a mechanism for the union of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sperm\">sperm</a>&nbsp;with eggs. Flowers may facilitate outcrossing (fusion of sperm and eggs from different individuals in a population) resulting from cross-pollination or allow selfing (fusion of sperm and egg from the same flower) when self-pollination occurs.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\"><p>The two types of pollination are: self-pollination and cross-pollination.&nbsp;<a href=\"https://en.wikipedia.org/wiki/Self-pollination\">Self-pollination</a>&nbsp;happens when the pollen from the anther is deposited on the stigma of the same flower, or another flower on the same plant.&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cross-pollination\">Cross-pollination</a>&nbsp;is the transfer of pollen from the anther of one flower to the stigma of another flower on a different individual of the same species. Self-pollination happens in flowers where the stamen and carpel mature at the same time, and are positioned so that the pollen can land on the flower\'s stigma. This pollination does not require an investment from the plant to provide nectar and pollen as food for pollinators.</p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group -->\n\n<!-- wp:post-content /-->\n\n<!-- wp:post-terms {\"term\":\"category\"} /-->\n\n<h2>Contact us</h2>\n<p><strong>Email :&nbsp; &nbsp; &nbsp;ouremailflower@eg.com</strong></p>\n<p><strong>Phone : **********</strong></p>\n<pre>&nbsp;</pre>\n<p>					<a target=\"_blank\" rel=\"noopener\"><br>\n						Facebook<br>\n											</a><br>\n					<a target=\"_blank\" rel=\"noopener\"><br>\n						Twitter<br>\n											</a><br>\n					<a target=\"_blank\" rel=\"noopener\"><br>\n						Youtube<br>\n											</a></p>\n<h2>Our Location</h2>\n<p>			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=kalamati%2Ckathmandu&amp;t=m&amp;z=15&amp;output=embed&amp;iwloc=near\" title=\"kalamati,kathmandu\" aria-label=\"kalamati,kathmandu\"></iframe></p>', 'Introduction', '', 'publish', 'closed', 'closed', '', 'home-this', '', '', '2021-10-26 12:50:44', '2021-10-26 12:50:44', '', 0, 'http://localhost/wordpress/?page_id=41', 0, 'page', '', 0),
