(90, 1, '2021-10-26 10:43:51', '2021-10-26 10:43:51', '<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr/>\n<!-- /wp:separator -->\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr/>\n<!-- /wp:separator -->\n<!-- wp:group -->\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p>A&nbsp;<strong>flower</strong>, sometimes known as a&nbsp;<strong>bloom</strong>&nbsp;or&nbsp;<strong><a href=\"https://en.wikipedia.org/wiki/Blossom\">blossom</a></strong>, is the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reproduction\">reproductive</a>&nbsp;structure found in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Flowering_plant\">flowering plants</a>&nbsp;(plants of the division&nbsp;<a href=\"https://en.wikipedia.org/wiki/Magnoliophyta\">Magnoliophyta</a>, also called&nbsp;<a href=\"https://en.wikipedia.org/wiki/Angiosperms\">angiosperms</a>). The biological function of a flower is to facilitate reproduction, usually by providing a mechanism for the union of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sperm\">sperm</a>&nbsp;with eggs. Flowers may facilitate outcrossing (fusion of sperm and eggs from different individuals in a population) resulting from cross-pollination or allow selfing (fusion of sperm and egg from the same flower) when self-pollination occurs.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p>The two types of pollination are: self-pollination and cross-pollination.&nbsp;<a href=\"https://en.wikipedia.org/wiki/Self-pollination\">Self-pollination</a>&nbsp;happens when the pollen from the anther is deposited on the stigma of the same flower, or another flower on the same plant.&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cross-pollination\">Cross-pollination</a>&nbsp;is the transfer of pollen from the anther of one flower to the stigma of another flower on a different individual of the same species. Self-pollination happens in flowers where the stamen and carpel mature at the same time, and are positioned so that the pollen can land on the flower\'s stigma. This pollination does not require an investment from the plant to provide nectar and pollen as food for pollinators.</p>\n<!-- /wp:paragraph -->\n<!-- /wp:group -->\n<!-- wp:post-content /-->\n<!-- wp:post-terms {\"term\":\"category\"} /-->		\n			<figure><img width=\"2560\" height=\"1440\" src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Name </h3><p>RS.210</p>		\n			<figure><img width=\"2560\" height=\"1440\" src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Name </h3><p>RS.210</p>		\n			<figure><img width=\"2560\" height=\"1440\" src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Name </h3><p>RS.210</p>		\n			<figure><img width=\"2560\" height=\"1440\" src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Name </h3><p>RS.210</p>		\n			<figure><img width=\"2560\" height=\"1440\" src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Name </h3><p>RS.210</p>		\n			<figure><img width=\"2560\" height=\"1440\" src=\"http://localhost/wordpress/wp-content/uploads/2021/10/550418-3.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Name </h3><p>RS.210</p>', 'INTRODUCTION', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2021-10-26 10:43:51', '2021-10-26 10:43:51', '', 41, 'http://localhost/wordpress/?p=90', 0, 'revision', '', 0),
